import math
class BinarySearchTree:
    def __init__(self):
        self.root = None

    def add(self, value):
        if self.root == None:
            self.root = BinarySearchTreeNode(value)
        else:
            self._add(value, self.root)

    def _add(self, value, node):
        if value < node.value:
            if node.left:
                self._add(value, node.left)
            else:
                node.left = BinarySearchTreeNode(value)
        elif value > node.value:
            if node.right:
                self._add(value, node.right)
            else:
                node.right = BinarySearchTreeNode(value)
        else:
            if not node.left and not node.right:
                return
            if not node.left and node.right:
                return
            if node.right:
                node.left = node.right
            else:
                node.right = node.right

    def search(self, value):
        return self._search(value, self.root)

    def _search(self, value, node):
        if not node:
            return False
        if node.value == value:
            return True
        if value < node.value:
            return self._search(value, node.left)
        else:
            return self._search(value, node.right)

    def get_min(self):
        if not self.root:
            return math.inf
        return self._get_min(self.root)

    def _get_min(self, node):
        while node.left:
            node = node.left
        return node.value

    def get_max(self):
        if not self.root:
            return -math.inf
        return self._get_max(self.root)

    def _get_max(self, node):
        while node.right:
            node = node.right
        return node.value

    def min_max(self):
        if not self.root:
            return -math.inf, -math.inf
        return self._min_max(self.root)

    def _min_max(self, node):
        if not node:
            return math.inf, -math.inf
        if node.left:
            return self._min_max(node.left)
        else:
            return math.inf, math.inf

    def get_h(self):
        if not self.root:
            return 0
        return self._get_h(self.root)

    def _get_h(self, node):
        if node:
            return 1 + max(self._get_h(node.left), self._get_h(node.right))
        return 0

    def get_e(self):
        if not self.root:
            return 0
        return self._get_e(self.root)

    def _get_e(self, node):
        if node.left and not node.right:
            return 1 + self._get_e(node.left)
        elif node.right and not node.left:
            return self._get_e(node.right)
        else:
            return 1 + max(self._get_e(node.left), self._get_e(node.right))

    def count(self):
        return self._count(self.root)

    def _count(self, node):
        if not node:
            return 0
        left_cnt = self._count(node.left)
        right_cnt = self._count(node.right)
        if left_cnt < right_cnt:
            return left_cnt + 1
        elif left_cnt > right_cnt:
            return right_cnt + 1
        else:
