    for n, dist in enumerate(distances, start=1):
        # if it is bigger than the first, it is the next distance.
        if dist > distances[n - 1]:
            distances[n] = distances[n - 1]
    # if the next element is smaller than the previous, it is the distance of the current car to the next element.
