class Solution:
    def ladderLength(self, beginWord: str, endWord: str, wordList: List[str]) -> int:
        # 정확한 가장 앞값이므로 재귀함수로 다시 풀면 실패
        def dfs(word: str, level: int, prev: str):
            if level == len(word):
                return 1
            if word[0]!= prev:
                return 0
            for c in word:
                next = c + '*' + prev
                if next in wordList:
                    return 0
                elif next not in map(str, range(10)):
                    return 0
                else:
                    map(lambda w: dfs(w, level+1, next), wordList)
            return 1

        # 여기에 재귀함수를 사용하면 된다. 제일 비싸 없는 자리는 그 자리에 *가 아닌 그 자리를 비워줘야 된다.
        return max(dfs(beginWord, 1, word), dfs(endWord, 0, word))

